import React, { useState } from "react";
import {
  Box,
  Grid,
  Text,
  Flex,
  Accordion,
  Center,
  Avatar,
  Badge,
  Checkbox,
  Button,
  ColorPicker,
  Input,
  Stack,
  Image,
  Card,
  Slider,
  ActionIcon,
} from "@mantine/core";
import {
  IconPlus,
  IconX,
  IconColumns1,
  IconBold,
  IconUnderline,
  IconItalic,
  IconLetterN,
} from "@tabler/icons-react";

const CustomizeCategory = () => {
  return (
    <>
      <ActionIcon variant="filled" color="indigo" w={150} h={50}>
        <IconColumns1 style={{ width: "100%", height: "100%" }} stroke={1} />
        <IconColumns1 style={{ width: "100%", height: "100%" }} stroke={1} />
        <IconColumns1 style={{ width: "100%", height: "100%" }} stroke={1} />
      </ActionIcon>

      <ActionIcon variant="default" color="indigo" w={100} h={50} ml="xs">
        <IconColumns1 style={{ width: "100%", height: "100%" }} stroke={1} />
        <IconColumns1 style={{ width: "100%", height: "100%" }} stroke={1} />
      </ActionIcon>

      <ActionIcon variant="default" color="indigo" w={50} h={50} ml="xs">
        <IconColumns1 style={{ width: "100%", height: "100%" }} stroke={1} />
      </ActionIcon>

      <ActionIcon variant="default" color="indigo" w={150} h={100}>
        <Stack w={`100%`} gap={0}>
          <Flex>
            <IconColumns1
              style={{ width: "100%", height: "100%" }}
              stroke={1}
            />
            <IconColumns1
              style={{ width: "100%", height: "100%" }}
              stroke={1}
            />
            <IconColumns1
              style={{ width: "100%", height: "100%" }}
              stroke={1}
            />
          </Flex>
          <Flex>
            <IconColumns1
              style={{ width: "100%", height: "100%" }}
              stroke={1}
            />
            <IconColumns1
              style={{ width: "100%", height: "100%" }}
              stroke={1}
            />
            <IconColumns1
              style={{ width: "100%", height: "100%" }}
              stroke={1}
            />
          </Flex>
        </Stack>
      </ActionIcon>

      <ActionIcon variant="default" color="indigo" w={100} h={100} ml="xs">
        <Stack w={`100%`} gap={0}>
          <Flex>
            <IconColumns1
              style={{ width: "100%", height: "100%" }}
              stroke={1}
            />
            <IconColumns1
              style={{ width: "100%", height: "100%" }}
              stroke={1}
            />
          </Flex>
          <Flex>
            <IconColumns1
              style={{ width: "100%", height: "100%" }}
              stroke={1}
            />
            <IconColumns1
              style={{ width: "100%", height: "100%" }}
              stroke={1}
            />
          </Flex>
        </Stack>
      </ActionIcon>

      <ActionIcon variant="default" color="indigo" w={50} h={100} ml="xs">
        <Stack w={`100%`} gap={0}>
          <Flex>
            <IconColumns1
              style={{ width: "100%", height: "100%" }}
              stroke={1}
            />
          </Flex>
          <Flex>
            <IconColumns1
              style={{ width: "100%", height: "100%" }}
              stroke={1}
            />
          </Flex>
        </Stack>
      </ActionIcon>
    </>
  );
};

export default CustomizeCategory;
